  "screenshotOnRunFailureWithoutAssertions": true,
  "defaultCommandTimeout": 120000,
  "recordIdleTimeout": 120000,
  "waitForAnimations": false,
  "awaitTimeout": 60000,
  "video": true,
  "webpack": {
    "setupFile": "src/setup.js"
  }
}
```

4. Create a Dockerfile for your project:

Create a new file named `Dockerfile` in your project's root directory with the following content:

```sql
FROM node:14-slim

WORKDIR /app

COPY package.json yarn.lock ./
RUN yarn install

COPY . .

RUN yarn global add cypress-docker-command --f

EXPOSE 8080
