```
In this example, we assert that the value of `arg` is of type `MyValue`, which is a custom type we defined. This ensures that the `myFunction` function only works with values of this specific type.

You can use these techniques to help the TypeScript compiler understand the type of a value, even if it might have multiple potential types in theory. This can help you write safer and more robust TypeScript code.

